                    <Router path="/home/*" element={<Home/>} />
                    <Router path="/products/*" element={<Products/>} />
                    {/*<Route path={"/home"} elements={<Home/>}/>*/}
                    {/*<Main/>*/}
                    {/*<Products/>*/}
                    {/*<Chats/>*/}
                </div>
                <Footer/>
            </div>
        </BrowserRouter>
    );
}

